import React from "react";
import { matchPc, matchTablet } from "../DetectDevice";
import { Grid } from "@material-ui/core";

function Interactionx({ setopeninteraction }: any): JSX.Element {
  return (
    <>
      <Grid
        container
        style={{
          width: matchPc ? "10%" : matchTablet ? "30%" : "10%",
          margin: "auto",
        }}
      ></Grid>
    </>
  );
}

export const Interaction = React.memo(Interactionx);
